import { Routes, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>PoopSwatch.com</p>
        <p>navbar with log in</p>
        <Routes>
          <Route path="/" element={<p>maine swatches</p>} />
          <Route path="css" element={<p>css</p>} />
          <Route path="MySwatches/LogIn" element={<p>mine!</p>} />
          <Route path="Create" element={<p>maka swatch</p>} />
        </Routes>
      </header>
    </div>
  );
}

export default App;
